def forward_pass(state, weights):
    policy_net_weight = weights['mlp_extractor.policy_net.0.weight']
    policy_net_bias = weights['mlp_extractor.policy_net.0.bias']

    policy_hidden_output = np.dot(state, np.array(policy_net_weight).T) + policy_net_bias
    policy_hidden_output = np.tanh(policy_hidden_output)  # Tanh activation, not ReLU

    action_output = np.dot(policy_hidden_output, np.array(weights['action_net.weight']).T) + weights['action_net.bias']
    return action_output


def distance_squared(a, b) -> float:
    return (a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2

def distance_squared_to_line(point, line_segments):
    x, y = point
    min_distance_squared = float('inf')

    for segment in line_segments:
        print(segment, file=sys.stderr, flush=True)
        (x1, y1), (x2, y2) = segment
        dx, dy = x2 - x1, y2 - y1

        dot_product = (x - x1) * dx + (y - y1) * dy
        t = max(0, min(1, dot_product / (dx ** 2 + dy ** 2)))
        closest_point = (x1 + t * dx, y1 + t * dy)

        segment_distance_squared = distance_squared((x, y), closest_point)
        min_distance_squared = min(min_distance_squared, segment_distance_squared)

    return min_distance_squared

